    return (
        <div className= "first-container">
            <video src={video} autoPlay loop muted/>
            <h1 >Adventure Awaits</h1>
            <div className="first-btns">
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'

        >
          GET STARTED
        </Button>


            </div>
        </div>
    )
}

